import React from 'react'
import RowTable from './RowTable'

export default function Items(props) {
    const item = props.item,
          playerstats = item.playerstats,
          title = item.title
          
    return (
        <section>
            <h3>{title}</h3>
            <table>
            {playerstats.map((player_data)=><RowTable player_data={player_data}/>)}
            </table>
        </section>
    )
}
